ssm_parameter.tf.code:
resource "aws_ssm_parameter" "parameter_from_CloudAI" {
  name  = "parameter_from_CloudAI"
  type  = "String" # Assuming we want to store a simple string. This can be changed to "StringList" or "SecureString" based on requirement.
  value = "your_value_here" # Please replace 'your_value_here' with the actual value you want to store.

  tags = {
    owner = "jeremy_wang"
  }
}

provider.tf.code:
provider "aws" {
  region = "us-east-1"  
}

provider "random" {
  # You may specify a Terraform version here if required
}

backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    # Optionally add encryption
    encrypt = false
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

random.tf.code:
resource "random_id" "postfix" {
  byte_length = 2 # This will generate a random 3-character base62 ID
}

resource "aws_ssm_parameter" "parameter_from_CloudAI" {
  name  = "parameter_from_CloudAI_${random_id.postfix.id}"
  type  = "String"
  value = "your_value_here" # Replace this with the actual value you want to store

  tags = {
    owner = "jeremy_wang"
  }
}
